import logo from './logo.svg';
import './App.css';
import react, { Component } from 'react';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Frankenstain',
          id: 'sdklfj'
        },
        {
          name: 'Dracula',
          id: 'sdklfsdvj'
        },
        {
          name: 'Zonbie',
          id: 'sdklfjccxc'
        }

      ]
    }

  }

  render() {
    return(
      <div className="App">
        {
          this.state.monsters.map(pro =>
            <h1 key={pro.id}>
              {pro.name}
            </h1>)
        }
      </div>
    );
  }
}

export default App;
